import React from "react";
import './banner.css';

function Banner() {
    return (
        <div className="banner">
            <div className="banner-content">
                <div className="left-text">
                    <h1>Sobre Nossa Empresa</h1>
                    <p>Somos uma empresa dedicada à inovação e excelência em nossos serviços. Com anos de experiência no mercado, oferecemos soluções sob medida para nossos clientes.</p>
                </div>
                <div className="right-text">
                    <h1>Nossa Missão</h1>
                    <p>Nossa missão é proporcionar valor através de serviços de alta qualidade e comprometimento, sempre focados em resultados e na satisfação dos nossos clientes.</p>
                </div>
            </div>
        </div>
    );
}

export default Banner;
